import React from 'react';

function Chancelight(props) {
  return (
    <>
      <div className="container-fluid mt-5 mychance">
        <div className="chance text-white">
          <div className="inchance">
            <h2>Chancelight</h2>
            <h3>ChanceLight uses Podio to educate thousands of American students.</h3>
            <span>
              <a href=""><i class="fa-regular fa-circle-play"></i>Watch video(1.11)</a>
            </span>
          </div>
        </div>
      </div>
    </>
  );
}

export default Chancelight;
